import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element (div with class 'cart')
    await page.waitForSelector('div.cart', { timeout: 5000 });

    // Click the cart element to open the shopping cart modal
    await page.click('div.cart');

    // Wait for the cart modal to appear (div with id 'cartModal' and style/display block)
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    // Wait for the cart modal to be visible
    const cartModal = await page.$('#cartModal');
    let isVisible = false;
    if (cartModal) {
      isVisible = await cartModal.evaluate(node => {
        return window.getComputedStyle(node).display !== 'none' && node.offsetParent !== null;
      });
    }

    // Take screenshot after opening cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_opened.png'));

    // Extract cart modal heading and cart items (if any)
    let cartHeading = null;
    let cartItemsCount = 0;
    if (isVisible) {
      cartHeading = await page.$eval('#cartModal .cart-content h2', el => el.textContent.trim()).catch(() => null);
      cartItemsCount = await page.$$eval('#cartItems .cart-item', els => els.length).catch(() => 0);
    }

    return {
      success: isVisible,
      action: "Opened the shopping cart modal",
      extractedData: {
        cartModalVisible: isVisible,
        cartHeading,
        cartItemsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
